import {useEffect} from 'react'
import {projectAuth} from '../firebase/config'

const Dashboard = () => {

  useEffect(()=>{
    projectAuth.onAuthStateChanged((user)=>{
      console.log(user)
    })
  })



  return ( 
    <h1>Hello About</h1>
   );
}
 
export default Dashboard;
